import 'dart:io';import 'package:hive_flutter/hive_flutter.dart';class Repository {  static const String key = 'history';  static init() async {    await Hive.initFlutter();    var s = await Hive.openBox(key);    s.clear();  }  add(var value,var time) async {    var box = Hive.box(key);    await box.add({value.toString(): time});    print({value.toString(): time});  }  getAll() {    var box = Hive.box(key);    var s = box.get(key);    return box.values.map((e) => Map.from(e)).toList();  }}